import React from "react";
import "./Hotel.css";

const Hotel = (props) => {
  const name = props.name;
  const departuredate = props.departuredate;
  const returndate = props.returndate;
  const price = props.price;
  const foto = props.foto;
  const rate = props.rate;
  const mealtype = props.mealtype;
  const roomtype = props.roomtype;
  const oceanview = props.oceanview;

  return (
    <div className="hotel">
      <div className="foto">
        <img src={foto} alt="hotel img" />
      </div>
      <div className="hotel-description">
        <div className="hotel-description__name">
          <p>{name}</p>
          <p>{rate}</p>
        </div>
        <div className="hotel-desctiption__info">
          <p>{oceanview == true ? "oceanview" : ""}</p>
          <p>{roomtype}</p>
          <p>{mealtype}</p>
        </div>
        <div className="hotel-desctiption__price">
          <p>{price}</p>
        </div>
      </div>
    </div>
  );
};

export default Hotel;
